INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256225426584', 'Plateau Asiatique 14 Pièces + Sauces', 'Mini-nems au porc (6x20g) : galette de riz garnie d\'une farce à base de viande de porc. Garniture 63% : préparation à base de viande de porc 25% [gorge de porc (origine : France) 10%, gras de porc (origine : France) 5%, morceau de tête de porc (origine : France) 5%, eau, fibre de BLE, sel], oignon, carotte, amidons de pois mungo et de maïs, pousse de haricot mungo, champignon noir, farine de riz, eau, sel, épices, gingembre, poivre, arôme naturel, huile de tournesol, sucre caramélisé. Galette de riz 34% : eau, farine de riz 12%, huile de tournesol, sel, sucre caramélisé. Huile de friture : huile de tournesol. Pourcentages exprimés sur le mini-nem au porc. Acras à la morue (4x20g) : bouchée garnie d\'une préparation à base de morue. Acra à la morue 95% : morue 35.5% [CABILLAUD (Gadus morhua ou Gadus ogac, pêché en Atlantique nord-est ou nord-ouest ou Gadus macrocephalus, pêché en Pacifique nord-est ou nord-ouest), sel], oignon, farine de BLE, eau, flocon de pomme de terre déshydratée (pomme de terre, antioxydant : extrait de romarin), persil, fécule de manioc, ail, poudres à lever : diphosphate disodique et carbonate acide de sodium, amidon de BLE, OEUF, jus de citron, sel, poivre, piment, arôme naturel. Huile de friture : huile de tournesol. Pourcentage exprimé sur l\'acra à la morue. Mini-samoussas au porc (2x30g) : galette de blé garnie d\'une farce à base de viande de porc. Garniture 69% : préparation à base de viande de porc 43% [gorge de porc (origine : France) 17%, gras de porc (origine : France) 8%, morceau de tête de porc (origine : France) 8%, eau, fibre de BLE, sel], oignon, eau, amidons de pois mungo et de maïs, épices, sel, arômes naturels, poivre, piment, farine de BLE, huile de tournesol. Galette de blé 29% : farine de BLE 20%, eau, sel, huile de tournesol, arôme naturel. Huile de friture : huile de tournesol. Pourcentages exprimés sur le mini-samoussa au porc. Beignets de crevette (2x20g) : pâte à beignet garnie d\'une crevette. Pâte à beignet 49% : farine de BLE, eau, OEUF, huile de tournesol, blanc d\'OEUF, poudres à lever : diphosphate disodique et carbonate acide de sodium, amidon de BLE, sel, poivre. CREVETTE (Penaeus spp, élevée en Equateur, Honduras, Inde, Indonésie, Pérou, Thaïlande ou Vietnam) 31,5%. Huile de friture : huile de tournesol. Pourcentages exprimés sur le beignet de crevette. Sauce aigre-douce 40g : eau, sucre, vinaigre d\'alcool, amidon transformé de maïs ou de pomme de terre, purée de piment (piment, sel, vinaigre d\'alcool), sel. Sauce au nuoc mâm 30g : eau, sucre, vinaigre d\'alcool, sel, nuoc mâm 1,6% (POISSON, sel, eau), sauce SOJA (eau, graines de SOJA, sel, farine de BLE). Pourcentage exprimé sur la sauce au nuoc mâm. Traces éventuelles de lait et d\'arachides.', '', '11', '2.7', '23', '4.6', '2', '5.8', '1.7', '0.669291338582677', '', '0');

